He'll be earning a lot of money (probably $1m plus) but the money he makes off ads is overstated and there'll be other revenue streams that aren't immediately apparent. There are number of things that people don't take into consideration.¬†

1) He works in collaboration with Polaris who take a cut of the earnings from his channel;
2) He probably doesn't earn anywhere near $10 per ad;
3) Not all partner videos feature pre-rolls, generally only 3 out of 10 do. Thus, about 7 out of 10 views won't count towards CPM totals;
4) An increasing number of web users are using Ad Blocker software in Firefox, Chrome, IE, Safari etc so he's not earning any money from those people;
5) I suspect a fair proportion of his income comes from monthly retainers/contracts with games companies to promote new games - after he has 25m subscribers and averages 3 million views per video. Getting him to play one of your games is a brilliant marketing strategy.¬†

He'll definitely be earning huge sums of money but the $7m per year figure is absolute fantasy.
